<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="vDataFrame.bar">vDataFrame.bar<a class="anchor-link" href="#vDataFrame.bar">&#182;</a></h1>
</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[&nbsp;]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vDataFrame</span><span class="o">.</span><span class="n">bar</span><span class="p">(</span><span class="n">columns</span><span class="p">:</span> <span class="nb">list</span><span class="p">,</span>
               <span class="n">method</span><span class="p">:</span> <span class="nb">str</span> <span class="o">=</span> <span class="s2">&quot;density&quot;</span><span class="p">,</span>
               <span class="n">of</span><span class="p">:</span> <span class="nb">str</span> <span class="o">=</span> <span class="s2">&quot;&quot;</span><span class="p">,</span>
               <span class="n">max_cardinality</span><span class="p">:</span> <span class="nb">tuple</span> <span class="o">=</span> <span class="p">(</span><span class="mi">6</span><span class="p">,</span> <span class="mi">6</span><span class="p">),</span>
               <span class="n">h</span><span class="p">:</span> <span class="nb">tuple</span> <span class="o">=</span> <span class="p">(</span><span class="kc">None</span><span class="p">,</span> <span class="kc">None</span><span class="p">),</span>
               <span class="n">hist_type</span><span class="p">:</span> <span class="nb">str</span> <span class="o">=</span> <span class="s2">&quot;auto&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Draws the Bar Chart of the input vcolumns based on an aggregation.</p>
<h3 id="Parameters">Parameters<a class="anchor-link" href="#Parameters">&#182;</a></h3><table id="parameters">
    <tr> <th>Name</th> <th>Type</th> <th>Optional</th> <th>Description</th> </tr>
    <tr> <td>columns</td> <td><div class="type">list</div></td> <td><div class = "no">&#10060;</div></td> <td>List of the vcolumns names. The list must have one or two elements.</td> </tr>
    <tr> <td><div class="param_name">method</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>The method used to aggregate the data.<br>
                                                    <ul>
                                                        <li><b>count :</b> Number of elements.</li>
                                                        <li><b>density :</b> Percentage of the distribution.</li>
                                                        <li><b>mean :</b> Average of the vcolumn 'of'.</li>
                                                        <li><b>min :</b> Minimum of the vcolumn 'of'.</li>
                                                        <li><b>max :</b> Maximum of the vcolumn 'of'.</li>
                                                        <li><b>sum :</b> Sum of the vcolumn 'of'.</li>
                                                        <li><b>q% :</b> q Quantile of the vcolumn 'of' (ex: 50% to get the median).</li>
                                                        </ul></td> </tr>
    <tr> <td><div class="param_name">of</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>The vcolumn used to compute the aggregation.</td> </tr>
    <tr> <td><div class="param_name">h</div></td> <td><div class="type">tuple</div></td> <td><div class = "yes">&#10003;</div></td> <td>Interval width of the vcolumns 1 and 2 bars. It is only valid if the vcolumns are numerical. Optimized h will be computed if the parameter is empty or invalid.</td> </tr>
    <tr> <td><div class="param_name">max_cardinality</div></td> <td><div class="type">tuple</div></td> <td><div class = "yes">&#10003;</div></td> <td>Maximum number of distinct elements for vcolumns 1 and 2 to be used as categorical (No h will be picked or computed)</td> </tr>
    <tr> <td><div class="param_name">hist_type</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>The Histogram Type.<br>
                                                    <ul>
                                                        <li><b>auto :</b> Regular Bar Chart based on 1 or 2 vcolumns.</li>
                                                        <li><b>stacked :</b> Stacked Bar Chart based on 2 vcolumns.</li>
                                                        <li><b>fully_stacked :</b> Fully Stacked Bar Chart based on 2 vcolumns.</li></ul></td> </tr>
</table>
</div>
</div>
</div>
